def get_idcard_info(idcard):
    url='http://116.62.12.56/idcard_info/?idcard={}'.format(idcard)
    times=5
    while(times):
        times=times-1
        try:
            response = requests.get(url).json()
            if 'data' in response.keys():
                break
        except:
            pass
    return response['data']
def get_mobile_info(mobile):
    try:
        url='http://116.62.12.56/mobile_info/?mobile={}'.format(mobile)
        response=requests.get(url).json()
        return response['data']
    except:
        pass

def load_city_level():
    city_level_2019 = pd.read_pickle('city_level_2019.pkl')
    tmp_city_level = city_level_2019.to_dict()['city_level']
    tmp_metropolitan_area = city_level_2019.to_dict()['metropolitan_area']
    tmp_three_area = city_level_2019.to_dict()['three_area']
    tmp_eight_eco_area = city_level_2019.to_dict()['eight_eco_area']
    tmp_hot_area = city_level_2019.to_dict()['hot_area']
    tmp_nation_area = city_level_2019.to_dict()['nation_area']
    return tmp_city_level,tmp_metropolitan_area,tmp_three_area,tmp_eight_eco_area,tmp_hot_area,tmp_nation_area


